import React from 'react';
import '../CSS/Homepage.css'

const Homepage = () => {
  return (
    <React.Fragment>
      <Header toggleSidebar={this.toggleSidebar} sidebarClassName={sidebarClassName} />

      <main>Homepage</main>
    </React.Fragment>
  );
};

export default Homepage;
